void loop() {
  // put your main code here, to run repeatedly:
  SerialMon.println("SEND AT");

  cur_time_led = millis();
  if (cur_time_led - old_time_led >= 1000) {
    counter++;
    switch (counter) {
      case 1:
        send_at("AT+CPIN?");
        break;
      case 2:
        send_at("AT+CSQ");
        break;
      case 3:
        send_at("AT+CPSI?");
        break;
      case 4:
        send_at("ATI");
        break;
      case 5:
        send_at("AT+IPR?");
        counter = 0;
        break;
    }

    if (ledState == LOW) {
      ledState = HIGH;
    } else {
      ledState = LOW;
    }

    digitalWrite(ledPin, ledState);
    old_time_led = cur_time_led;
  }
}

void send_at(char *_command) {
  SerialAT.println(_command);
  wRespon(1000);
}

void wRespon(long waktu) {
  cur_time = millis();
  old_time = cur_time;
  while (cur_time - old_time < waktu ) {
    cur_time = millis();
    while (SerialAT.available() > 0) {
      SerialMon.print(SerialAT.readString());
    }
  }
}


